import React from "react";
import Axios from "axios"



function GetNews() {

    Axios.get("https://api.spaceflightnewsapi.net/v4/docs/#/articles/articles_list").then((resp)=>{
        console.log(resp.data);
    })

    return (
      console.log('hello')
    );
  }

  export default GetNews;
